import React, {useState, useEffect} from 'react';

const Footer = () => {
   return(
      <footer>
         <div id="Jimmy">
            <p>© GYMMEWIN</p> <br/>
            <a href="https://www.linkedin.com/in/gymmewin/"> <img src="https://cdn-icons-png.flaticon.com/128/61/61109.png" alt="LinkedIn" className="icons"/> </a>

            <a href="https://github.com/gymmewin"> <img src="https://cdn-icons-png.flaticon.com/128/733/733609.png" alt="Github" className="icons"/> </a>
         </div>

         <div id="Zach">
            <p>© ZACH MONEA </p> <br/>
            <a href="https://www.linkedin.com/in/zachary-monea/" alt="LinkedIn" className="icons"> </a>

            <a href="https://github.com/zmonea"> <img src="https://cdn-icons-png.flaticon.com/128/733/733609.png" alt="Github" className="icons"/> </a>
         </div>
      </footer>
   )
}
export default Footer;
